import axios from "axios";

/** base url to make request to the themoviedatabase */

const instance = axios.create({
  baseURL: "http://localhost:5000/api/movies",
  withCredentials: false,
  headers: {
    "Access-Control-Allow-Origin": "*",
    "ACcess-Origin-Allow-Methods": "GET,PUT,POST,DELETE,PATCH,OPTIONS",
  },
});

// instance.get('/foo-bar');
// https://api.themoviedb.org/3/foo-bar
// https://api.themoviedb.org/3/discover/tv?api_key=504b85f6fe0a10a9c7f35945e14e7ddf&with_network=123
// https://api.themoviedb.org/3/search/movie?api_key=504b85f6fe0a10a9c7f35945e14e7ddf&language=en-US

export default instance;
